/**
  * @brief  Startup : Shows ST logo and slogan
  * @param  None
  * @retval None
  */
void k_StartUp(void)
{
  uint32_t XPos = 50, XOffset = 5;
  const char ST_Slogan[] = "life.augmented";
  const char *p = ST_Slogan;

  GUI_SetBkColor(GUI_WHITE);
  GUI_Clear();
  GUI_DrawBitmap(&bmSTLogo, (LCD_GetXSize() - (bmSTLogo.XSize))/2 , (LCD_GetYSize() - (bmSTLogo.YSize) - 30)/2);
    
  GUI_SetFont(&GUI_FontAvantGarde16);
  GUI_SetColor(GUI_STCOLOR_LIGHTBLUE);
  
  do{
    GUI_DispCharAt(*p, XPos , 150);
    XPos += GUI_GetCharDistX(*p++) + XOffset + 1;
    if(*p == '.')
    {
      GUI_SetColor(GUI_STCOLOR_DARKBLUE    );
      XOffset = 0;
    }    
    GUI_Delay(20);
  }while (*p != 0);

  GUI_Delay(1000);     
}

